import React, { useState } from "react";
import DadosPessoas from "./DadosPessoas";
import { DadosUsuarios } from "./DadosUsuarios";
import { Entrega } from "./Entrega";

function FormularioCadastro() {

  return (

    <>
      <DadosPessoas/>
      <DadosUsuarios/>
      <Entrega/>
    </>
  )
}

export default FormularioCadastro;
